import { BrowserRouter, Routes, Route } from 'react-router-dom';
import './App.css';

import Home from './Pages/Home/Home'
import Paper from './Pages/Paper/Paper'

function App() {
  return (
    <BrowserRouter>
       <Routes>
          <Route path='/' element={<Home/>}/>
        <Route path='/Paper' element={<Paper seconds={600} />} />
       </Routes>
    </BrowserRouter>

  );
}

export default App;
